import React from 'react';
import AddIcon from '@mui/icons-material/Add';  

const Member = () => {  
    return (  
        <div className="ml-[25%] p-5 w-full"> 
            {/* block for banner */}  
            <div className='border-2 bg-slate-900 flex justify-between w-full text-white rounded-lg p-3'>
                <button className="bg-slate-900 border border-white text-white px-5 py-1.5 rounded-full hover:bg-blue-900 flex items-center transition-colors">
                    Add Member
                    <AddIcon className="ml-1" fontSize="small" />
                </button>  
                <button className="bg-slate-900 border border-white text-white px-5 py-1.5 rounded-full hover:bg-blue-900 flex items-center transition-colors">
                    Membership
                    <AddIcon className="ml-1" fontSize="small" />
                </button>
            </div>  

            {/*  */}
        </div>  
    );  
}  

export default Member;
